CREATE TABLE IF NOT EXISTS `django_migrations` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group_permissions` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`), `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`));
CREATE TABLE IF NOT EXISTS `auth_user_groups` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`), `group_id` integer NOT NULL REFERENCES `auth_group` (`id`));
CREATE TABLE IF NOT EXISTS `auth_user_user_permissions` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`), `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`));
CREATE TABLE IF NOT EXISTS `django_admin_log` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `action_time` timestamp NOT NULL, `object_id` varchar(8) NULL, `object_repr` varchar(200) NOT NULL, `change_message` varchar(255) NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`), `user_id` integer NOT NULL REFERENCES `auth_user` (`id`), `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0));
CREATE TABLE IF NOT EXISTS `django_content_type` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_permission` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`), `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS `auth_user` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `password` varchar(128) NOT NULL, `last_login` timestamp NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `last_name` varchar(150) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` timestamp NOT NULL, `first_name` varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` varchar(500) NOT NULL, `expire_date` timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS `store_customer` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(200) NULL, `email` varchar(200) NULL, `user_id` integer NULL UNIQUE REFERENCES `auth_user` (`id`));
CREATE TABLE IF NOT EXISTS `store_order` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `date_order` timestamp NOT NULL, `complete` bool NULL, `transaction_id` varchar(200) NULL, `customer_id` bigint NULL REFERENCES `store_customer` (`id`));
CREATE TABLE IF NOT EXISTS `store_shippingaddress` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `address` varchar(200) NULL, `city` varchar(200) NULL, `state` varchar(200) NULL, `zipcode` varchar(200) NULL, `date_added` timestamp NOT NULL, `customer_id` bigint NULL REFERENCES `store_customer` (`id`), `order_id` bigint NULL REFERENCES `store_order` (`id`));
CREATE TABLE IF NOT EXISTS `store_orderitem` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `quantity` integer NULL, `date_added` timestamp NOT NULL, `order_id` bigint NULL REFERENCES `store_order` (`id`), `product_id` bigint NULL REFERENCES `store_product` (`id`));
CREATE TABLE IF NOT EXISTS `store_product` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(200) NULL, `price` double NULL, `digital` bool NULL, `image` varchar(100) NULL);
